import React, {Component} from 'react';
import NavBar from './components/navbar';
import Counters from './components/counters';


class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      items: [],
      isLoaded: false,
    }
  }

  ComponentDidMount(){
    fetch('http://localhost:3000/record')
    .then(res => res.json())
    .then(json => {
        this.setState({
          isLoaded: true,
          items: json,
          })
    })

  }

  render(){ 
    return (
      <React.Fragment>
        <NavBar />
          <main className="container">
            <Counters/>
          </main> 
      </React.Fragment>
    );
  }
}
export default App;
